import './index.css';

function MainPage() {
	return (
		<div>	
			<div id="header">
				<div>
					<p id="title"><img src="images/mainLogo.png"></img>&nbsp;한성마켓</p>

				</div>
			</div>
			<div id="body">
				<div id="banner">
					<p><img src="images/bannerImg.png" width="250"/> 한성대학교만의 마켓</p>

				</div>
			</div>
		</div>
	);
}

export default MainPage;
